import React from "react";
import { NavLink } from "react-bootstrap";
import s from "./Login.module.css";

const Login = () => {
    return (
        <div className = {s.row}>
            <div className = {s.col-6}>
            <li className={s.item}>
                <NavLink className={`logo me-3 nav`} to="/main">
                  Craft Cuts
                </NavLink>
              </li>
            </div>
            <div className = {s.col-6}></div>
        </div>
    );
}

export default Login;
